import Reactotron from 'reactotron-react-js';

// verifica se o usu치rio est치 em ambiente de desenvolvimento
if(process.env.NODE_ENV === 'development') {
  const tron = Reactotron.configure().connect();

  tron.clear();

  console.tron = tron;
}
